import React , {useState} from "react";
import {Drawer, List,ListItem } from "@material-ui/core"
import {IoHome} from "react-icons/io";

function Menu() {
   return( <Drawer open={true}>
       <List>
        <ListItem button></ListItem>
        <IoHome/>
       </List>

    </Drawer>

   );
    
}

export default Menu;
